import json

import requests

from uuid import uuid4


class CrawlVietNamAddressData:
    def __init__(self):
        self.base_url = 'https://thongtindoanhnghiep.co/api/'
        self.suffix_city = 'city'
        self.suffix_district = 'city/{city}/district'
        self.suffix_ward = 'district/{district}/ward'

        self.country_id = 'bbf52b7b-77ed-4e8c-af0a-86ca00771d83'
        self.city_data = []
        self.district_data = []
        self.ward_data = []

    def crawl_country_data(self):
        self.crawl_city_data(country_id=self.country_id)

        with open('cities.json', 'w+', encoding='utf-8') as fdata:
            fdata.write(json.dumps(self.city_data, ensure_ascii=False))
        with open('districts.json', 'w+', encoding='utf-8') as fdata:
            fdata.write(json.dumps(self.district_data, ensure_ascii=False))
        with open('wards.json', 'w+', encoding='utf-8') as fdata:
            fdata.write(json.dumps(self.ward_data, ensure_ascii=False))
        return True

    def crawl_city_data(self, country_id):
        resp = requests.get(self.base_url + self.suffix_city)
        data = resp.json()
        if data:
            for item in data['LtsItem']:
                _id = str(uuid4())
                self.city_data.append(
                    {
                        'id': _id,
                        'country_id': country_id,
                        'title': item['Title'],
                        'id_crawler': item['ID'],
                    }
                )
                self.crawl_district_data(item['ID'], _id)
        return True

    def crawl_district_data(self, city_id, my_city_id):
        resp = requests.get(self.base_url + self.suffix_district.format(city=city_id))
        data = resp.json()
        if data:
            for item in data:
                _id = str(uuid4())
                self.district_data.append(
                    {
                        'id': _id,
                        'city_id': my_city_id,
                        'id_crawler': item['ID'],
                        'title': item['Title'],
                    }
                )
                self.crawl_ward_data(item['ID'], _id)
        return True

    def crawl_ward_data(self, district_id, my_district_id):
        resp = requests.get(self.base_url + self.suffix_ward.format(district=district_id))
        data = resp.json()
        if data:
            for item in data:
                self.ward_data.append(
                    {
                        'id': str(uuid4()),
                        'district_id': my_district_id,
                        'id_crawler': item['ID'],
                        'title': item['Title'],
                    }
                )
        return True

